import React from 'react';
import { dummyPost } from '../dummy.js';
import styled from 'styled-components';

export const Postform = styled.div`
display: inline-block;
width: 300px;
height: 300px;
border: solid rgb(238, 238, 238) 0.1rem;
margin: 0.3rem;
background-color: white;
`
export const Postforms =styled.div`
width: 300px;
height: 10px;
`
export const Postcontent = styled.div`
white-space: nowrap;
overflow:hidden;
text-overflow: ellipsis;
`
export const Postimg = styled.img`
flex: 2 1 100%;
width: 280px;
height: 210px;
margin: 0.5rem;
border: 0.5px solid rgb(238, 238, 238);
object-fit: cover;
`
export const Posttitle = styled.span`
flex: 1 2 30%;
float: left;
margin-left: 1rem;
font-weight: 400;
`
export const Postlike = styled.span`
flex: 1 2 30%;
float: right;
margin-right: 1rem;
font-weight: 700;
`

export default function Boardpostform(){
    return(
        <center>
            <Postform>
            <Postimg src={dummyPost[0].image} alt={dummyPost[0].title} />

            <Postforms>
            <Posttitle >{dummyPost[0].title}</Posttitle>
            <Postcontent>{dummyPost[0].contents}</Postcontent>
            <Postlike>{dummyPost[0].total_likes}</Postlike>
            </Postforms>
            </Postform>
            <Postform>
            <Postimg src={dummyPost[1].image} alt={dummyPost[1].title} />
            </Postform>
            <Postforms>
            <Posttitle >{dummyPost[1].title}</Posttitle>
            <Postcontent>{dummyPost[1].contents}</Postcontent>
            <Postlike>{dummyPost[1].total_likes}</Postlike>
            </Postforms>

        </center>
    )
}
